import React, { useEffect } from 'react'
import ThreeLogo from 'components/ThreeLogo'
import "assets/styles/rondoudou.scss"

const Home = () => {

    useEffect(() => {
        console.log('Hello bg')
        for (let i = 0; i < 2; i++) {
            setTimeout(function() {
                document.getElementsByClassName('poke-letter')[i].classList.toggle('grow')
            }, 200 * i);   
        }
    });

    return (
        <div className='homepage'>
            <h1 className='home-title'><span className="poke-letter poke-1">Po</span><span className="poke-letter poke-3">k</span><span className="poke-letter poke-4">é</span><span className="poke-letter poke-5">l</span><span className="poke-letter poke-6">a</span><span className="poke-letter poke-7">n</span><span className="poke-letter poke-8">d</span></h1>
            <div className="websiteInfos">
                <p>Sur ce site, vous pourrez...</p>
                <ul className='webInfo-list'>
                    <li>
                        Trouver des cartes pokémons rares.
                    </li>
                    <li>
                        Commander ces cartes auprès de collectionneurs.
                    </li>
                    <li>
                        Enregistrer les plus belles cartes dans vos favoris.
                    </li>
                </ul>
            </div>
            <div className='my-canvas'>
                <ThreeLogo />
            </div>
        </div>
    )
}

export default Home
